  false,\n\t\"url\": null,\n\t\"notes\": \"Underwater Site 9P was established off
  Rose Atoll, American Samoa by Dr. James Maragos, U.S. Fish & Wildlife Service, on
  July 31, 1999. The site was originally called Site C and later renamed Site 9P.
  With a start point (meter 0) at latitude 14 33.075S longitude 168 09.622W, a series
  of metal stakes were pounded into the substrate to delineate a 51-meter line that
  could be relocated and reassessed on future surveys. A fiberglass tape was unrolled
  along the line marked by the stakes and a series of photographs was taken of the
  benthos in consecutive 1-meter-square (1m x 1m) quadrats, using a Nikon RS camera
  with 35mm color-positive slide film in an underwater housing mounted atop a 1-meter-square
  (1m x 1m) quadrat. The color-positive slides were later scanned (600dpi) using the
  Epson V750 scanner and software. The overall goal was to acquire data from the photographs
  and analyze and present quantitative data in a manner to be useful for scientists
  and refuge management. Each image is labeled with a 3-letter location code (ROS),
  date (31July99), site number (9P), and meter interval along the transect line (e.g.,
  5-6M). The software program SigmaScan Pro 5.0 was used to analyze each image. Analysis
  was completed by a single observer, Alison Veit. For each photoquadrat, the anthozoan
  colonies were identified (scleractinian genera Montipora, Pocillopora, Favia, Favites,
  Montastrea, Goniastrea) and the maximum diameter (cm) of each colony determined.
  The center of each colony had to fall within the photoquadrat frame in order to
  be counted for a photoquadrat. If the colony extended beyond one photoquadrat, one
  diameter was determined and counted in the photoquadrat in which the center of the
  colony was found. After all the anthozoan colonies in the photoquadrat had been
  measured, the data were binned into 7 size classes (1-5 cm, 6-10 cm, 11-20 cm, 21-40
  cm, 41-80 cm, 81-160 cm, >160 cm.  A visual estimate of percent coral cover in each
  quadrat was also recorded.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
